INSERT INTO `code_system` VALUES (1,'2014-03-07 10:59:04','2014-03-07 10:59:04','sysadmin','SNOMED CT ','SNOMED-Clinical Terms','2.16.840.1.113883.6.96','Systematized Nomenclature of Medicine-Clinical Terms'),(2,'2014-03-07 10:59:04','2014-03-07 10:59:04','sysadmin','ICD-10-CM ','ICD-10-Clinical Modification','2.16.840.1.113883.6.90','The International Classification of Diseases, 10th Revision, Clinical Modification'),(3,'2014-03-07 10:59:04','2014-03-19 10:50:53','consent2share.sysadmin','ICD-9-CM ','ICD-9-Clinical Modification','2.16.840.1.113883.6.103','The International Classification of Diseases, 9th Revision, Clinical Modification'),(4,'2014-03-07 10:59:04','2014-03-07 10:59:04','sysadmin','LOINC ','LOINC','2.16.840.1.113883.6.1','Logical Observation Identifier Names and Codes'),(5,'2014-03-07 00:46:57','2014-03-07 00:49:40','consent2share.sysadmin','PH_RxNorm','RxNorm','2.16.840.1.113883.6.88','Catalog of the standard names given to clinical drugs and drug delivery devices'),(6,'2014-03-20 09:11:45','2014-03-20 09:11:45','consent2share.sysadmin','HCPCS','HCPCS','2.16.840.1.113883.6.14','Healthcare Common Procedure Coding System'),(7,'2014-03-21 11:57:10','2014-03-21 11:58:00','consent2share.sysadmin','CPT-4','CPT-4','2.16.840.1.113883.6.12','American Medical Association\'s Current Procedure Terminology 4 (CPT-4) codes');
INSERT INTO `value_set_category` VALUES (1,'2014-04-01 06:28:24','2014-06-20 11:24:58','consent2share.sysadmin','ETH','Substance use information sensitivity','Drug use is a patterned use of a substance (drug) in which the user consumes the substance in amounts or with methods neither approved nor advised by medical professionals. Substance use/drug use is not limited to mood-altering or psycho-active drugs. If an activity is performed using the objects against the rules and policies of the matter (as in steroids for performance enhancement in sports), it is also called substance abuse. Therefore, mood-altering and psychoactive substances are not the only types of drugs abused. Using illicit drugs \\u2013 narcotics, stimulants, depressants (sedatives), hallucinogens, cannabis, even glues and paints, are also considered to be classified as drug/substance abuse.'),(2,'2014-04-01 06:28:24','2014-04-01 06:28:24','sysadmin','GDIS','Genetic disease information sensitivity','A genetic disorder is an illness caused by one or more abnormalities in the genome, especially a condition that is present from birth (congenital). Most genetic disorders are quite rare and affect one person in every several thousands or millions. Genetic disorders are heritable, and are passed down from the parents\' genes. Other defects may be caused by new mutations or changes to the DNA. In such cases, the defect will only be heritable if it occurs in the gene line. The same disease, such as some forms of cancer, may be caused by an inherited genetic condition in some people, by new mutations in other people, and by nongenetic causes in still other people.'),(3,'2014-04-01 06:28:24','2014-04-01 06:28:24','sysadmin','HIV','HIV/AIDS information sensitivity','Human immunodeficiency virus infection / acquired immunodeficiency syndrome (HIV/AIDS) is a disease of the human immune system caused by infection with human immunodeficiency virus (HIV). During the initial infection, a person may experience a brief period of influenza-like illness. This is typically followed by a prolonged period without symptoms. As the illness progresses, it interferes more and more with the immune system, making the person much more likely to get infections, including opportunistic infections and tumors that do not usually affect people who have working immune systems.'),(4,'2014-04-01 06:28:24','2014-06-20 11:20:35','consent2share.sysadmin','PSY','Mental health information sensitivity','A mental disorder or psychiatric disorder is a psychological pattern or anomaly, potentially reflected in behavior, that is generally associated with distress or disability, and which is not considered part of normal development in a person\'s culture. Mental disorders are generally defined by a combination of how a person feels, acts, thinks or perceives. This may be associated with particular regions or functions of the brain or rest of the nervous system, often in a social context.'),(6,'2014-04-01 06:28:24','2014-04-01 06:28:24','sysadmin','SEX','Sexuality and reproductive health information sensitivity','Human sexuality is the capacity to have erotic experiences and responses. Human sexuality can also refer to the way someone is sexually attracted to another person \\u2013 which is determined by their sexual orientation \\u2013 whether it is to the opposite sex (heterosexuality), to the same sex (homosexuality), having both these tendencies (bisexuality), to all gender identities (pansexuality or bisexuality), or not being attracted to anyone in a sexual manner (asexuality). Human sexuality impacts cultural, political, legal, and philosophical aspects of life. It can refer to issues of morality, ethics, theology, spirituality, or religion. Some cultures have been described as sexually repressive. Within the framework of the World Health Organization\'s (WHO) definition of health as a state of complete physical, mental and social well-being, and not merely the absence of disease or infirmity, reproductive health, or sexual health/hygiene, addresses the reproductive processes, functions and system at all stages of life. Reproductive health, therefore, implies that people are able to have a responsible, satisfying and safer sex life and that they have the capability to reproduce and the freedom to decide if, when and how often to do so. One interpretation of this implies that men and women ought to be informed of and to have access to safe, effective, affordable and acceptable methods of birth control; also access to appropriate health care services of sexual, reproductive medicine and implementation of health education programs to stress the importance of women to go safely through pregnancy and childbirth could provide couples with the best chance of having a healthy infant. On the other hand individuals do face inequalities in reproductive health services. Inequalities vary based on socioeconomic status, education level, age, ethnicity, religion, and resources available in their environment. It is possible for example, that low income individuals lack the resources for appropriate health services and the knowledge to know what is appropriate for maintaining reproductive health.'),(9,'2014-04-01 05:14:20','2014-06-20 11:21:04','consent2share.sysadmin','ALC','Alcohol use and Alcoholism Information','Alcohol use and Alcoholism (alcohol dependence) are two different forms of problem drinking.  Alcohol use is when an individualÃ¢ÂÂs drinking leads to problems, but not physical addiction.  Alcoholism is when an individual has signs of physical addiction to alcohol and continues to drink, despite problems with physical health, mental health, and social, family, or job responsibilities. '),(10,'2014-06-20 11:40:50','2014-06-27 11:14:01','consent2share.sysadmin','COM','Communicable disease information sensitivity','Illnesses that are transmitted through contact with microorganisms. People, animals, food, surfaces, and air can all be carriers of the microorganisms that pass infectious illnesses from one host to the next, allowing a communicable disease to spread.  '),(11,'2014-06-20 11:42:00','2014-06-27 11:14:29','consent2share.sysadmin','ADD','Addictions information sensitivity','Continued repetition of a behavior despite adverse consequences, or a neurological impairment leading to such behaviors. Addictions can include, but are not limited to, drug abuse, exercise addiction, food addiction, computer addiction, sex/pornography and gambling. Classic hallmarks of addiction include impaired control over substances or behavior, preoccupation with substance or behavior, continued use despite consequences, and denial. Habits and patterns associated with addiction are typically characterized by immediate gratification (short-term reward), coupled with delayed deleterious effects (long-term costs). ');
